import style from "./message.style.module.css";

export default function Message() {
  return (
    <div className={style.container}>
        Meu amor, como eu gostaria de ver seu sorriso de pertinho quando eu te desse parabéns 
        neste seu dia especial, eu quero lhe desejar um feliz aniversário! E como eu queria poder 
        celebrar ao seu lado, como eu queria fazer essa distância entre desaparecer,
        estou com saudades.

        Parabéns pretinha! Desejo que tenha um dia muito feliz! Deus te abenções, desejo muita saude, muita paz, e que até você chegue, 
        não apenas esta mensagem, mas todo o meu amor, as saudades e os beijos que guardo ansiosos para você.
    </div>
  );
}
